import {
	Box,
	Table,
	TableBody,
	TableCell,
	TableContainer,
	TableHead,
	TableRow,
} from '@mui/material';
import { useEffect, useState } from 'react';

export const App = () => {
	const [data, setData] = useState(null);

	const getData = () => {
		fetch('/data')
			.then((newData) => newData.json())
			.then((d) => {
				console.log(d.data);
				setData(d.data);
			});
	};
	useEffect(() => {
		getData();
	}, []);
	return (
		<Box
			display={'flex'}
			alignItems="center"
			justify="center"
			width="100vw"
			minHeight="100vh"
		>
			<Text position="absolute" top="5vh">
				S&P 500 Index Data
			</Text>
			{data && <DataTable data={data} />}
		</Box>
	);
};

const DataTable = ({ data }) => {
	let sym = ['Symbol'];
	const columns = sym.concat(Object.keys(data[0][1]));

	const renderRows = () => {
		return data.map((row) => {
			return (
				<TableRow>
					<TableCell>{row[0]}</TableCell>
					{columns.slice(1, columns.length).map((c, idx) => {
						return (
							<TableCell key={idx}>
								<Text>{row[1][c]}</Text>
							</TableCell>
						);
					})}
				</TableRow>
			);
		});
	};

	const renderHeader = () => {
		return columns.map((c, idx) => {
			return (
				<TableCell key={idx}>
					<Text fontSize={18} fontWeight="semibold">
						{c}
					</Text>
				</TableCell>
			);
		});
	};
	return (
		<TableContainer

			width="70vw"
			height="70vh"
		>
			<Table stickyHeader>
				<TableHead>
					<TableRow>{renderHeader()}</TableRow>
				</TableHead>

				<TableBody>{renderRows()}</TableBody>
			</Table>
		</TableContainer>
	);
};
